import * as o from "react";
import r from "../lib/IconBase.es.js";
import l from "../defs/Football.es.js";
const t = o.forwardRef((a, e) => /* @__PURE__ */ o.createElement(r, { ref: e, ...a, weights: l }));
t.displayName = "FootballIcon";
const s = t;
export {
  s as Football,
  t as FootballIcon
};
